export class FinanceRenderComponent extends React.PureComponent{
    acceptInvoice = (event) =>{
        console.log(event.target.value);
        console.log("event");


    }
    rejectInvoice = (event) =>{
        console.log(event.target);

        }

    render(){
        return(
            <>
            <tr className={this.props.ticket.reimbursementStatus} >
                <td>{this.props.ticket.reimbursementID}</td>
                <td>{this.props.ticket.description}</td>
                <td>${this.props.ticket.reimbursementAmount}</td>
                <td>{this.props.ticket.reimbursementType}</td>
                <td>{this.props.ticket.reimbursementStatus}</td>
                <td>{new Date(this.props.ticket.submitted).toLocaleDateString()}</td>
                <td>{this.props.ticket.userRole}</td>
                <td><button className="btn btn-succes"  value={this.props.ticket.reimbursementID} onClick={this.acceptInvoice}>Accept</button></td>
                <td><button  value={this.props.ticket.reimbursementID} onClick={this.rejectInvoice} >Reject</button></td>
            </tr>
            </>
        )
    }
}
